import Navbar from "../Components/Navbar";

function AdminS() {
  return (
    <div className="App">
        <div className="p-0 m-0 flex">
          <Sidebar />
          <div>
            <Navbar />
          </div>
        </div>
    </div>
  );
}

export default AdminS;
